class Home extends Component {

  render() {
    return (        
        <Router>

          <Route path="/" exact render={()=>{
            return(
                <div>
                  <nav className="navbar navbar-expand-lg navbar-light bg-light">
                    <Dropdown>
                      <Dropdown.Toggle variant="secondary" id="dropdown-basic">
                        Menu
                      </Dropdown.Toggle>
                      <Dropdown.Menu>
                        <Dropdown.Item href="/">Cupones</Dropdown.Item>
                        <Dropdown.Item href="/validar">Validar Cupones</Dropdown.Item>
                      </Dropdown.Menu>
                    </Dropdown>
                    <img src="https://1000logos.net/wp-content/uploads/2017/12/krispy-kreme-logo.png" style={{width:'50px', height:'30px', position:'absolute', right:'20'}}/>
                  </nav>
                  <GridExample/>
                </div>
            );
          }} 
          />
          <Route path="/validar/" exact render={()=>{
            return(
                <div>
                  <Validar/>
                </div>
            );
          }} 
          />


        </Router>        
    );
  }
}


ReactDOM.render(<Home></Home>, document.querySelector('#root'));
